import React from "react";

class EditFishForm extends React.Component {
  render() {
    return (
      <div className="fish-edit">
        <input type="text" name={this.props.fish.name} />
        <input type="text" name={this.props.fish.price} />
        <select type="text" name={this.props.fish.status}>
          <option value="available">Fresh!</option>
          <option value="unavailable">Sold Out!</option>
        </select>
        <textarea type="text" name={this.props.fish.desc}></textarea>
        <input type="text" name={this.props.fish.image} />
      </div>
    );
  }
}

export default EditFishForm;
